import React from "react";
import { Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import StudentRegisterPage from "./pages/StudentRegisterPage";
import StudentLoginPage from "./pages/StudentLogin";
import StudentDashboardPage from "./pages/StudentDashboard";
import IndustryRegisterPage from "./pages/IndustryRegister";
import IndustryLoginPage from "./pages/IndustryLogin";
import IndustryDashboardPage from "./pages/IndustryDashboard";
import AdminLoginPage from "./pages/AdminLogin";
import AdminDashboardPage from "./pages/AdminDashboard";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/register" element={<StudentRegisterPage />} />
      <Route path="/student-login" element={<StudentLogin />} />
      <Route path="/student-dashboard" element={<StudentDashboard />} />
      <Route path="/industry-register" element={<IndustryRegister/>} />
      <Route path="/industry-login" element={<IndustryLogin />} />
      <Route path="/industry-dashboard" element={<IndustryDashboard/>} />
      <Route path="/admin-login" element={<AdminLogin />} />
      <Route path="/admin-dashboard" element={<AdminDashboard/>} />
      {/* Add other routes if needed */}
    </Routes>
  );
}

export default App;
